import React from 'react';
import Controls from '../../Components/Controls/Controls';
import FormPages from '../FormPages';
import { Typography } from '@material-ui/core';


const PageThree = (props: any) => {
    const { values, nextStep, prevStep, helpTexts, handleInputChange } = props;

    const handleSliderChange = (e: any, newValue: any) => {
        console.log(newValue);
        console.log(e.target.getAttribute('data-index'))
    };

    return (
        <FormPages.MiddlePage
            nextStep={nextStep}
            prevStep={prevStep}
            handleInputChange={handleInputChange}
            values={values}
        >
            <Typography gutterBottom>
                Custom marks
            </Typography>
            {[...Array(parseInt(values.numSpecialSets) || 0)].map((_, i) => {
                return (
                    <Controls.SpecialSliders data-index={i} handleSliderChange={handleSliderChange} />
                );
            })}
            {/* <Controls.Input
                helpText={helpTexts.numSpecialSets}
                label="Number of special sets"
                name="numSpecialSets"
                value={values.numSpecialSets}
                onInput={handleInputChange}
            /> */}
        </FormPages.MiddlePage>
    );
};

export default PageThree;
